.text
.globl main
# t3 is all background
# t0 start index for background

main:
	jal Start_Menu
	li $v0, 32 #loading sleep service
	li $a0, SLEEP # Wait 0.05 secs testing...
	syscall

	jal Initialize
	jal Load_Background
	jal Load_Ship_Red
	jal Load_Ship_Blue
	li $t7,3
	li $t8,3
	jal Load_Health_Bar
	li $s0,2
	li $s1,2
	jal Game_Level
	jr $ra
Start_Menu:
	li $t0,0
	li $t3,16384
	Load_Menu:
		lw $t1,Menu($t0)
		sw $t1,Space($t0)
		addi $t0,$t0,4
		bne $t0,$t3,Load_Menu
	lb $t0,S
	lb $t1,E
	j menu_input
start:
	jr $ra


Initialize:
	li $t0,0
	li $t3,16384
	jr $ra
Load_Background:
	lw $t1,Base($t0)
	sw $t1,Space($t0)
	addi $t0,$t0,4
	bne $t0,$t3,Load_Background
	li $t0, 1280
	li $t3,5120
	jr $ra
Load_Ship_Red:
	addi $t2,$t0,-1280
	lw $t1,Ship_Red_Center($t2)
	sw $t1,Space($t0)
	addi $t0,$t0,4
	bne $t0,$t3,Load_Ship_Red
	li $t0,11264
	li $t3,15104
	jr $ra
Load_Ship_Blue:
	addi $t2,$t0,-11264
	lw $t1,Ship_Blue_Center($t2)
	sw $t1,Space($t0)
	addi $t0,$t0,4
	bne $t0,$t3,Load_Ship_Blue
	jr $ra
Load_Health_Bar:
# t7  for player 1
# t8 for player 2
#!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
li $t0,0
li $t2,700
li $t5,956
layerVertical:
lw $t4,Ship($0)
sw $t4,Space($t5)
addi $t5,$t5,52
add $t0,$t0,4
# t5=1224 for health bar
bne $t0,8,layerVertical
li $t0,0
layer1H:
li $t3,56
lw $t4,Ship($0)
sw $t4,Space($t2)
addi $t0,$t0,4
addi $t2,$t2,4
bne $t0,$t3,layer1H
li $t0,0
li $t2,1212
layer2H:
li $t3,56
lw $t4,Ship($0)
sw $t4,Space($t2)
addi $t0,$t0,4
addi $t2,$t2,4
bne $t0,$t3,layer2H
li $t0,0
li $t5,960
healthBar:
li $t3,48
lw $t4,health($0)
sw $t4,Space($t5)
addi $t0,$t0,4
addi $t5,$t5,4
bne $t0,$t3,healthBar
li $t0,0
li $t2,15292
li $t5,15548
layerVertical2:
lw $t4,Ship($0)
sw $t4,Space($t5)
addi $t5,$t5,52
add $t0,$t0,4
# t5=15304 for health bar
bne $t0,8,layerVertical2
li $t0,0
layer1H2:
li $t3,56
lw $t4,Ship($0)
sw $t4,Space($t2)
addi $t0,$t0,4
addi $t2,$t2,4
bne $t0,$t3,layer1H2
li $t0,0
li $t2,15804
layer2H2:
li $t3,56
lw $t4,Ship($0)
sw $t4,Space($t2)
addi $t0,$t0,4
addi $t2,$t2,4
bne $t0,$t3,layer2H2
li $t0,0
li $t5,15552
healthBar2:
li $t3,48
lw $t4,health($0)
sw $t4,Space($t5)
addi $t0,$t0,4
addi $t5,$t5,4
bne $t0,$t3,healthBar2
jr $ra



Game_Level:
	#$s0 is red's position (1-2-3)
	#$s1 is blue's position (1-2-3)
	#$t7 is red's health
	#$t8 is blue's health
	j red_input
red_done:
	li $a0, SLEEP
	li $v0,42
	li $a0,20	#RNG
	li $a1,2
	syscall
	move $s5,$a0	# $s5 is the random number that chooses if this iteration will shoot or not
	beq $s5,1,Shoot_or_Not
	jal update_health
	j Game_Level
Shoot_or_Not:
	li $v0,42
	li $a0,20	#RNG
	li $a1,2
	syscall
	move $s5,$a0	# $s5 is the random number that chooses if this iteration will shoot or not
	beq $s5,1,Who_Shoots
Who_Shoots:
	li $v0,42
	li $a0,20	#RNG
	li $a1,2
	syscall
	move $s5,$a0	# $s5 is the random number that chooses who will shoot (1 for red, 2 for blue)
	beq $s5,1,red_shoot
	beq $s5,0,blue_shoot
done:
	jr $ra
	
	


red_shoot:
	li $v0,31
	li $a0,30
	li $a1,2500
	li $a2,127
	li $a3,127
	syscall
	jal draw_boom_red
	beq $s0,$s1,blue_damaged
	li $v0, 32
	li $a0, SLEEP1
	syscall
	jal draw_red
	jal draw_blue
	j red_input_loop

blue_shoot:
	li $v0,31
	li $a0,30
	li $a1,2500
	li $a2,127
	li $a3,127
	syscall
	jal update_health
	jal draw_boom_blue
	beq $s0,$s1,red_damaged
